import './dashboard.css';


function Dashboard() {

    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(filmFilm)
    }, [])

    return (
        <div>
            <h1>Coucou</h1>
        </div>
    )
}

export default Dashboard
